import React, { useState, useEffect } from 'react';
import authService from '../../services/authService';

import VerCursos from './VerCursos';
import Recursos from './Recursos';
import CrearTarea from './CrearTarea';
import VerTareas from './VerTareas';
import VerForos from './VerForos';
import TomarAsistencia from './TomarAsistencia';
import VerAsistencias from './VerAsistencias';
import './profesorCss/profesor.css';

const ProfesorDashboard = () => {
    const [user, setUser] = useState(null);
    const [selectedOption, setSelectedOption] = useState('');
    const [subSelectedOption, setSubSelectedOption] = useState('');

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const userData = await authService.getUserData();
                setUser(userData);
            } catch (error) {
                console.error("Error al obtener datos del usuario:", error);
            }
        };
        fetchUserData();
    }, []);

    const handleMenuClick = (option) => {
        setSelectedOption(option);
        setSubSelectedOption('');
    };

    const handleSubMenuClick = (subOption) => {
        setSubSelectedOption(subOption);
    };

    if (!user) {
        return <div>Cargando...</div>;
    }

    return (
        <div className="dashboard-container">
            <div className="sidebar">
                <nav className="menu">
                    <ul>
                        <li>
                            <button onClick={() => handleMenuClick('cursos')}>Cursos</button>
                            {selectedOption === 'cursos' && (
                                <ul className="submenu">
                                    <li>
                                        <button onClick={() => handleSubMenuClick('verCursos')}>Ver Cursos</button>
                                        {subSelectedOption === 'verCursos' && (
                                            <ul className="submenu">
                                                <li>
                                                    <button onClick={() => handleSubMenuClick('recursos')}>Recursos</button>
                                                </li>
                                            </ul>
                                        )}
                                    </li>
                                </ul>
                            )}
                        </li>
                        <li>
                            <button onClick={() => handleMenuClick('tareas')}>Tareas</button>
                            {selectedOption === 'tareas' && (
                                <ul className="submenu">
                                    <li><button onClick={() => handleSubMenuClick('verTareas')}>Ver Tareas</button></li>
                                    <li><button onClick={() => handleSubMenuClick('crearTareas')}>Crear Tareas</button></li>
                                </ul>
                            )}
                        </li>
                        <li>
                            <button onClick={() => handleMenuClick('foros')}>Foros</button>
                            {selectedOption === 'foros' && (
                                <ul className="submenu">
                                    <li><button onClick={() => handleSubMenuClick('verForos')}>Ver Foros</button></li>
                                </ul>
                            )}
                        </li>
                        <li>
                            <button onClick={() => handleMenuClick('asistencia')}>Asistencia</button>
                            {selectedOption === 'asistencia' && (
                                <ul className="submenu">
                                    <li><button onClick={() => handleSubMenuClick('verAsistencias')}>Ver Asistencias</button></li>
                                    <li><button onClick={() => handleSubMenuClick('tomarAsistencias')}>Tomar Asistencias</button></li>
                                </ul>
                            )}
                        </li>
                    </ul>
                </nav>
            </div>
            <div className='main-content'>
                <div className='header'>
                    <h1>Bienvenido, {user.nombre}</h1>
                    <button onClick={authService.cerrarSesion}>Cerrar Sesi√≥n</button>
                </div>
                <div className='content'>
                    {subSelectedOption === 'verCursos' && <VerCursos />}
                    {subSelectedOption === 'recursos' && <Recursos />}
                    {subSelectedOption === 'verTareas' && <VerTareas />}
                    {subSelectedOption === 'crearTareas' && <CrearTarea />}
                    {subSelectedOption === 'verForos' && <VerForos />}
                    {subSelectedOption === 'verAsistencias' && <VerAsistencias />}
                    {subSelectedOption === 'tomarAsistencias' && <TomarAsistencia />}
                </div>
            </div>
        </div>
    );
};

export default ProfesorDashboard;
